let counter = 0;
// byr (Birth Year) - four digits; at least 1920 and at most 2002.
// iyr (Issue Year) - four digits; at least 2010 and at most 2020.
// eyr (Expiration Year) - four digits; at least 2020 and at most 2030.
// hgt (Height) - a number followed by either cm or in:
// If cm, the number must be at least 150 and at most 193.
// If in, the number must be at least 59 and at most 76.
// hcl (Hair Color) - a # followed by exactly six characters 0-9 or a-f.
// ecl (Eye Color) - exactly one of: amb blu brn gry grn hzl oth.
// pid (Passport ID) - a nine-digit number, including leading zeroes.
// cid (Country ID) - ignored, missing or not.

function checkPassports(input) {
  for (let i=0; i < input.length; i++) {
    let brian = Object.keys(input[i])
    if (!brian.includes('cid') && brian.length === 7 || brian.includes('cid') && brian.length === 8) {
      let mar = input[i];
      //BIRTH YEAR
      if (parseInt(mar.byr) >= 1920 && parseInt(mar.byr) <= 2002){
        //ISSUE YEAR
        if (parseInt(mar.iyr) >= 2010 && parseInt(mar.iyr) <= 2020){
          //EXPIRATION YEAR
          if (parseInt(mar.eyr) >= 2020 && parseInt(mar.eyr) <= 2030){
            //HEIGHT
            let num = parseInt(mar.hgt.replace(/\D/g,''))
            let meas = mar.hgt.replace(/\d/g,'')
            if ((meas === "cm" && num >= 150 && num <= 193) || (meas === "in" && num >= 59 && num <= 76)){
              //HAIR COLOR
              let hex = mar.hcl.slice(1,mar.hcl.length).replace(/[^a-f0-9]/)
              let hasHash 
              (mar.hcl[0] === '#')? hasHash = true : hasHash = false;
              if (hasHash && hex.length === 6) {
                //EYE COLOR
                let colors = ["amb", "blu", "brn", "gry", "grn", "hzl", "oth"]
                if (colors.includes(mar.ecl)){
                  //PASSPORT IDS
                  if (mar.pid.length === 9 && Number.isInteger(parseInt(mar.pid))) {
                    counter++;
                  }
                }
              }
            }
          }
        }
      }
    }
    
  }
  
}
